package cn.com.phinfo.protocol;import cn.com.phinfo.oaact.MyApplet;import com.heqifuhou.protocolbase.HttpResultBeanBase;import com.heqifuhou.protocolbase.QuickRunObjectBase;import com.heqifuhou.utils.MyDeviceBaseUtils;public class SysUpdateRun extends QuickRunObjectBase {	public SysUpdateRun() {		super(LURLInterface.GET_URL_SYSUPDATE(MyDeviceBaseUtils.getCurrAppVer(MyApplet.getInstance())),AppDownLoadResultBean.class);	}	public static class AppDownLoadResultBean extends			HttpResultBeanBase {		private String version;		private String downloadUrl;		public String getVersion() {			return version;		}		public void setVersion(String version) {			this.version = version;		}		public String getDownloadUrl() {			return downloadUrl;		}		public void setDownloadUrl(String downloadUrl) {			this.downloadUrl = downloadUrl;		}	}	}